    return (
        <div className='details'>
            <h1>Details</h1>
            <h3>COMPANY DETAILS</h3>
            Company:Epam
            <p>EPAM Systems, Inc. is an American company that specializes<br></br> in service development,
                digital platform engineering, and digital<br></br> product design. One of the world's largest
                manufacturers of custom <br></br>software and consulting providers. The company's headquarters <br></br>is located in Newtown,
                Pennsylvania, and its branches are <br></br>represented in more than 40 countries.</p>
        </div>
    )
}
